import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import Array_obj from './Array';
import './index.css';

    const User_Selection="netflix";
function apple(params) {


if(User_Selection==="netflix"){
  ReactDOM.render(
    <React.Fragment>

    <h1 className="heading_style">List of top five Netflix Series </h1>

    {
      Array_obj.map((val)=>{
        return(
            <Card
        key={val.id}
        imgsrc={val.imgsrc}
        title={val.title}
        link={val.link}
        name={val.name}

        />
        )
      })
    }

    </React.Fragment>,
    document.getElementById("root")
    )
}

}
